import React from "react"
import {slides} from "../consts"

export default function ReleasePage() {
  return (
    <main>
      <h1>Releases</h1>
      <section>
        {slides.map(({name, image, description}) => 
          <div>
            <h3>{name}</h3>
          </div>
        )}
      </section>
    </main>
  )
}
